import React from 'react';
import Link from "next/link";

export default function Navbar(){
    return (
        <div style={{display: "flex",justifyContent : "center",color:"white !important",backgroundColor : "black",textDecoration : "none"}}>
            <Link href="/"><a title="Home">Home</a></Link>
            <Link href="/about"><a title="About">About</a></Link>
            <Link href="/user"><a title="About">User</a></Link>
        </div>
    )

}
